import React from "react";


class Inner_nav_item extends React.Component{
    render() {
        return (
            <ul className={"flex-column col-4"}>
                {this.props.inner_menu.map((inner_nav_item) => {
                    return inner_nav_item.map((list_item, j) => {
                        return <li key={j}>
                            {list_item.href ? <a href={list_item.href}>{list_item.title}</a> : <h3 className={"sub_header"}>{list_item.title}</h3>}
                        </li>
                    })}
                )}
            </ul>
        )
    }
}

export default Inner_nav_item;
